import React, { Component } from 'react';
import './style.css';
import Job from './job';

class Work extends Component{
   constructor(){
    super()
   } 
   render(){
    return(
        <React.Fragment>
        
    <div className='work_container'>
          <h1> <i>MY </i> WORK</h1> 
        <Job/>
        <Job/>
        <Job/> 
    </div>
    </React.Fragment>
        
 
    )
   }
}
export default Work;
